import React, { Fragment } from "react"
import {childRouter} from "../../router/index"
import {NavLink} from "react-router-dom" 
function Index(){
    return(
        <Fragment>
            <nav className="childNav">
                {childRouter.map((item,index)=>{
                    <NavLink 
                        to={item.path}
                        exact={item.exact}
                        activeClassName={item.active}
                >{item.title}</NavLink>
                })}
            </nav>
        </Fragment>
    )
}

export default Index
